import Hot__memes from "../hot__memes/Hot__memes";
// import { PageNotFound } from "../../components/PageNotFound/PageNotFound.component";
import Regular__memes from "../regular__memes/Regular__memes";

const Routing = () => (
  <Switch>
    <Route path="/" exact>
      <Redirect to="/hot" />
    </Route>
    <Route path="/hot" component={Hot__memes} exact />
    <Route path="/regular" component={Regular__memes} />
    {/* <Route path="/favourites" component={FavouritesMemes} /> */}
    {/* <Route path="/addMeme" component={AddMemeForm} /> */}
    {/* <Route path="*" component={PageNotFound} /> */}
  </Switch>
);

export default Routing;
